PGP Desktop Professional 9.0&lt;br&gt;&lt;p&gt;

PGP Desktop Professional provides comprehensive security for individual desktops, making it possible for organizations to protect sensitive information for a single person without changing the existing IT infrastructure or disrupting work processes. This award-winning, easy-to-use solution encrypts email, files, virtual volumes, and entire disks from a single desktop application.&lt;br&gt;&lt;p&gt;

PGP Desktop Professional protects confidential data in email and in files; secures data on mobile computing devices; facilitates compliance with existing and emerging regulations for information security; and enables organizations to comply, at the individual desktop level, wth the information security requirements of business partners.&lt;br&gt;&lt;p&gt;
